(17,	877,	557,	'CY123',	NULL,	'2022-07-26',	'2022-07-31',	'pexels-pixabay-87777-tourMainImg-1658380954.jpg',	'Chardham Yatra',	'Indore to Gangotri',	'standard',	12000,	'6',	NULL,	NULL,	'Uttrakhand',	'Entry tickets and maintenance charges',	'Lunch',	NULL,	NULL,	'duration-12N/13D',	'7419874562',	'a) The request for name change will be treated as a fresh booking where confirmation will be subject to availability. Please note all bookings confirmed are non-transferable and will invite a cancellation charge as applicable.',	NULL,	'Rajesh sharma',	'9874556478',	'4564645645',	'ICICI BANK',	'Test Account',	'787895544445777',	'Indore Main Branch',	'456486456546',	'45654456456456',	'rnt road',	NULL,	NULL,	NULL,	'indore',	99,	2,	0,	NULL,	NULL,	NULL,	1,	'2022-07-21 05:22:34',	'2022-07-21 05:22:34'),
(18,	877,	557,	'GV123',	NULL,	'2022-07-31',	'2022-08-03',	'pexels-cottonbro-4428286-tourMainImg-1658383004.jpg',	'GOA VACATIONS',	'GOA VACATIONS',	'standard',	9950,	'4',	NULL,	NULL,	'Indore, South Goa, North Goa, Goa',	'Transportation from Indore to Goa and Goa to Indore\nPickup and Drop from Goa Airport/Railway Station/Volvo Stand to Hotel\nWelcome Drink on Arrival\nAccommodation on twin/double sharing basis\nBed Tea, Breakfast and Dinner\nAll Sight seeing By Personal Non Sharing Taxi\nIncluding all Parking Charges, Toll Tax, Green Tax and Driver Stay\nAll applicable taxes, entry fee and driver allowance',	NULL,	NULL,	NULL,	'Launching of Goa Vacations flight package of 03 Nights & 04 Days tour Ex Indore for your leisure vacation at beaches of Goa including sightseeing of North & South Goa.',	'7419874562',	'a) The request for name change will be treated as a fresh booking where confirmation will be subject to availability. Please note all bookings confirmed are non-transferable and will invite a cancellation charge as applicable.\nb) Changes and Cancellation by RoadNStay prior to your departure - The journeys are planned well in advance. We reserve the right to make changes to the programmed if necessary at any point of time. We reserve the right to cancel the departure or amend the same due to certain operational reasons and conditions. Most changes made by us would be minor, but on certain occasions there could be a possibility of making a significant change. A change is defined as significant if it involves a change of destination or date of departure. In such an eventuality, we would inform you as soon as possible and provide you with the following solutions: \n\n1. Or accepting the cancellation where you will receive a refund of the payment remitted to us. However, there will be no refund for any service such as pre/post accommodation, airline tickets, excursions, and extensions etc. that have been booked by you and/or your Travel Agent. \nc) In case of a \'force majeure\' situation due to which a departure has to be cancelled, we regret there would be no refund of the money paid to us or reimbursement of any additional expenses incurred by you as a result of our cancellation/ change. \n\n \n\n100% payment at the time of booking will be required.\n\nOn completion of the booking and payment formalities, a confirmation tour voucher will be generated.\nYou will have to pay all bank charges.\nIn case of cash payment of INR 25000/- or above, the Pan Card copy of the client is required.',	NULL,	'Manish kumar ji',	'7489582547',	NULL,	NULL,	'Test Account First',	'9789456123XXX',	'Indore Main Branch',	'4564564567889',	'849456464564',	'rnt road',	NULL,	NULL,	NULL,	'indore',	99,	2,	1,	NULL,	NULL,	NULL,	1,	'2022-07-21 05:56:44',	'2022-07-21 05:56:44'),
(19,	877,	557,	'ML789',	NULL,	'2022-08-01',	'2022-08-05',	'pexels-ruchit-darji-5592828-tourMainImg-1658386065.jpg',	'Manali',	'Getaway to Manali from Delhi',	'standard',	22385,	'5',	NULL,	NULL,	'Manali, Delhi',	'5 TRANSFERS\n5 ACTIVITIES',	'Package price does not include Gala dinner charges applicable on Christmas and New Year\'s Eve',	NULL,	NULL,	'Manali - 4 Nights Stay',	'7418795874',	'Standard check-in time at the hotel is normally 2:00 pm and check-out is 11:00 am. An early check-in, or a late check-out is solely based on the discretion of the hotel.\nA maximum of 3 adults are allowed in one room. The third occupant shall be provided a mattress/rollaway bed.\nThe itinerary is fixed and cannot be modified. Transportation shall be provided as per the itinerary and will not be at disposal. For any paid activity which is non-operational due to any unforeseen reason, we will process refund & same should reach the guest within 30 days of processing the refund.\nAlso, for any activity which is complimentary and not charged to MMT & guest, no refund will be processed.\nAC will not be functional anywhere in cool or hilly areas.\nEntrance fee, parking and guide charges are not included in the packages.\nIf your flights involve a combination of different airlines, you may have to collect your luggage on arrival at the connecting hub and register it again while checking in for the onward journey to your destination.\nBooking rates are subject to change without prior notice.\nAirline seats and hotel rooms are subject to availability at the time of booking.\nPricing of the booking is based on the age of the passengers. Please make sure you enter the correct age of passengers at the time of booking. Passengers furnishing incorrect age details may incur penalty at the time of travelling.\nIn case of unavailability in the listed hotels, arrangement for an alternate accommodation will be made in a hotel of similar standard.\nIn case your package needs to be cancelled due to any natural calamity, weather conditions etc. MakeMyTrip shall strive to give you the maximum possible refund subject to the agreement made with our trade partners/vendors.\nMMT reserves the right to modify the itinerary at any point, due to reasons including but not limited to: Force Majeure events, strikes, fairs, festivals, weather conditions, traffic problems, overbooking of hotels / flights, cancellation / re-routing of flights, closure of /entry restrictions at a place of visit, etc. While we will do our best to make suitable alternate arrangements, we would not be held liable for any refunds/compensation claims arising out of this.\nCertain hotels may ask for a security deposit during check-in, which is refundable at check-out subject to the hotel?s policy.',	NULL,	'Ramesh Kumar',	'7895846544',	'9874563210',	'Test Bank',	'Test Account First',	'9789456123XXX',	'Indore Main Branch',	'45454574877',	'54454545554',	'rnt road',	NULL,	NULL,	NULL,	'indore',	99,	2,	1,	NULL,	NULL,	NULL,	1,	'2022-07-21 06:47:45',	'2022-07-21 06:47:45'),
(20,	877,	557,	'FKV147',	NULL,	'2022-08-01',	'2022-08-06',	'pexels-sanket-barik-7846490-tourMainImg-1658388194.jpg',	'Fabulous Kashmir Vacation',	'Kashmir Vacation',	'standard',	29000,	'6',	NULL,	NULL,	'Srinagar, Gulmarg, Pahalgam, Srinagar',	'Tour Manager Assistance',	NULL,	NULL,	NULL,	'5 DAY PLAN\n1 HOTEL\n5 TRANSFERS\n5 ACTIVITIES',	'9685741458',	'Standard check-in time at the hotel is normally 2:00 pm and check-out is 11:00 am. An early check-in, or a late check-out is solely based on the discretion of the hotel.\nA maximum of 3 adults are allowed in one room. The third occupant shall be provided a mattress/rollaway bed.\nThe itinerary is fixed and cannot be modified. Transportation shall be provided as per the itinerary and will not be at disposal.For any paid activity which is non-operational due to any unforeseen reason, we will process refund & same should reach the guest within 30 days of processing the refund.\nAt most hotels in Kashmir, a room heater (if required) is available on request and on a direct payment basis.\nThe houseboats in Kashmir operate in a different way than those in Kerala. All houseboats on Dal Lake are stationary and offer amazing views of the lake and the surroundings. Accommodation in the quaint houseboats of Kashmir is purely for the experience. Unlike hotels, houseboats are faced with certain limitations like 24x7 electricity and water supply, a television in each room, etc.\nAs per govt. orders, pre',	NULL,	'kamal thakur',	'9874525844',	'9874563210',	'ICICI BANK',	'Test Name',	'787895544445777',	'Indore Main Branch',	'545454598989',	'564545454545',	'rnt road',	NULL,	NULL,	NULL,	'indore',	99,	NULL,	1,	NULL,	NULL,	NULL,	1,	'2022-07-21 07:23:14',	'2022-07-21 07:23:14'),
(21,	877,	557,	'DLF78',	NULL,	'2022-08-03',	'2022-08-10',	'pexels-ankur-khandelwal-4851376-tourMainImg-1658495938.jpg',	'vaisnodevi with kashmir',	'Indore to vaishno devi',	'standard',	51000,	'8',	NULL,	NULL,	'Jammu, Katra, Patnitop, Pahalgam, Gulmarg, Srinagar',	NULL,	NULL,	NULL,	NULL,	'8 DAY PLAN\n2 FLIGHTS\n5 HOTELS\n7 TRANSFERS\n9 ACTIVITIES',	'7419874562',	'Standard check-in time at the hotel is normally 2:00 pm and check-out is 11:00 am. An early check-in, or a late check-out is solely based on the discretion of the hotel.\nA maximum of 3 adults are allowed in one room. The third occupant shall be provided a mattress/rollaway bed.\nThe itinerary is fixed and cannot be modified. Transportation shall be provided as per the itinerary and will not be at disposal.For any paid activity which is non-operational due to any unforeseen reason, we will process refund & same should reach the guest within 30 days of processing the refund.\nAlso, for any activity which is complimentary and not charged to MMT & guest, no refund will be processed.\nAC will not be functional anywhere in cool or hilly areas.\nEntrance fee, parking and guide charges are not included in the packages.\nIf your flights involve a combination of different airlines, you may have to collect your luggage on arrival at the connecting hub and register it again while checking in for the onward journey to your destination.\nBooking rates are subject to change without prior notice.\nAirline seats and hotel rooms are subject to availability at the time of booking.\nPricing of the booking is based on the age of the passengers. Please make sure you enter the correct age of passengers at the time of booking. Passengers furnishing incorrect age details may incur penalty at the time of travelling.\nIn case of unavailability in the listed hotels, arrangement for an alternate accommodation will be made in a hotel of similar standard.\nIn case your package needs to be cancelled due to any natural calamity, weather conditions etc. MakeMyTrip shall strive to give you the maximum possible refund subject to the agreement made with our trade partners/vendors.\nMMT reserves the right to modify the itinerary at any point, due to reasons including but not limited to: Force Majeure events, strikes, fairs, festivals, weather conditions, traffic problems, overbooking of hotels / flights, cancellation / re-routing of flights, closure of /entry restrictions at a place of visit, etc. While we will do our best to make suitable alternate arrangements, we would not be held liable for any refunds/compensation claims arising out of this.\nCertain hotels may ask for a security deposit during check-in, which is refundable at check-out subject to the hotel?s policy.\nThe booking price does not include: Expenses of personal nature, such as laundry, telephone calls, room service, alcoholic beverages, mini bar charges, tips, portage, camera fees etc.\nAny other items not mentioned under Inclusions are not included in the cost of the booking.\nThe package price doesn?t include special dinner or mandatory charges at time levied by the hotels especially during New Year and Christmas or any special occasions. MakeMyTrip shall try to communicate the same while booking the package. However MakeMyTrip may not have this information readily available all the time.\nCost of deviation and cost of extension of the validity on your ticket is not included.\nFor queries regarding cancellations and refunds, please refer to our Cancellation Policy.',	NULL,	'pandit ramkrishan ji',	'7894562584',	NULL,	'ICICI BANK',	'Test Account',	'9789456123XXX',	'Indore Main Branch',	'415454545544545',	'7878888888888',	'rnt road',	NULL,	NULL,	NULL,	'indore',	99,	2,	0,	NULL,	NULL,	NULL,	1,	'2022-07-21 08:25:21',	'2022-07-21 08:25:21'),
(50,	877,	557,	'PD147',	NULL,	'2022-08-09',	'2022-08-15',	'pexels-pixabay-462341-tourMainImg-1658812745.jpg',	'Paris Departure!',	'India to france',	'standard',	190000,	'7',	NULL,	NULL,	'New Delhi\nParis\nAdelboden\nZurich',	'Included services',	'Not Included services',	NULL,	NULL,	'7 DAY PLAN\n2 FLIGHTS\n3 HOTELS\n2 TRANSFERS\n2 ACTIVITIES',	'7412583698',	'Please note that VISA cost is not included in the package. Make my trip provides visa assistance only.\nPlease note that once your booking is confirmed, you will receive an e-mail as well as an SMS on your registered mobile number confirming your booking. However, if you would like to get in touch with us please call us on 0124-4859749. We are open from 8:00 am to 8:00 pm, seven days a week.\nPlease expect to receive your vouchers 72 hours before your departure date (subject to full payment of your package cost)\nPlease note that these packages are customizable, which means that you will be able to make changes to the itinerary/activity if you so desire. The final payment will be calculated as per the activities reflecting on the website which will be outlined in the confirmatory e-mail sent to you.\nPersonal expenses such as laundry, telephone calls, room service, alcoholic beverages, mini bar etc., are not included.\nIn case your package needs to be cancelled due to any natural calamity, weather conditions etc. RoadNStay shall strive to give you the maximum possible refund subject to the agreement made with our trade partners/vendors.\nIf payment is not made as per the schedule provided in the first booking confirmation e-mail, RoadNStay reserves the right to cancel the booking after attempting to get in touch with you. Refunds would be as per the package cancellation policy.\nThe passenger names in the booking form should be exactly as per passports. RoadNStay will not bear any liability for the name change fee, if incorrect names and ages have been added at the time of booking.\nPlease note that if your package includes a flight which is a low cost carrier (Like Air Asia, Scoot Airlines, Air Arabia, Jetstar, Fly Dubai, Thai AirAsia, Air India Express, Tiger Airways, Vueling, Delta, Ryan Air, Pegasus, Indigo Etc) then baggage and meals will not be included in the package untill specified in the booking. Baggage and meals can be added as per your requirement at an additional cost depending on the airlines and destination. Our Travel Expert will attempt to get in touch with you within 24-hours after the booking has been confirmed for any addition required.\nPlease ensure that baggage and any other upgrade requirements (if any) are given to our Travel Expert latest by 5 days before the date of departure.\nStandard check-in time at the hotel is normally 3:00 pm and check-out is 11:00 am. An early check-in, or a late check-out is solely based on the discretion of the hotel.\nIn case the selected hotel is unavailable for booking, an alternate arrangement will be offered to the customer in another hotel of a similar category.\nCertain hotels abroad may ask for a security deposit during check-in, which is refundable at check-out subject to the hotels policy.\nPlease note that Day at Leisure essentially implies that no sightseeing activities have been included for that day\nKindly be on time for your activities, tours and transfers as stipulated in the handover vouchers (reporting time). International countries are quite strict about following a schedule, else you will miss your services and no refund will be provided.\nThe package price does not include special dinner or mandatory charges at time levied by the hotels especially during New Year and Christmas or any special occasions. RoadNStay shall try to communicate the same while booking the package. However RoadNStay may not have this information readily available all the time.\nFor queries regarding cancellations and refunds, please refer to our Cancellation Policy.\nDisputes, if any, shall be subject to the exclusive jurisdiction of the courts in New Delhi.\n\n\nClosed Sightseeings due to COVID',	NULL,	's k vyas',	'9874562584',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Paris, France',	'48.856614',	'2.3522219',	'Paris',	'Paris',	73,	2,	1,	NULL,	NULL,	NULL,	1,	'2022-07-26 05:19:05',	'2022-07-26 05:19:05'),
